// src/components/Dashboard.js
import React from "react";
import { useNavigate } from "react-router-dom";
import "../styles.css"; // Make sure this file contains your CSS

const Dashboard = () => {
  const navigate = useNavigate();

  const handleStart = (category) => {
    navigate(`/exercises/${category}`);
  };

  const categories = [
    {
      title: "Neurological",
      description:
        "Patients include: Parkinson’s, Cerebral palsy, stroke, etc.",
    },
    {
      title: "Physiotherapy",
      description:
        "Rehabilitation for post-surgery, joint pain, etc. (arm, posture).",
    },
    {
      title: "Orthopaedic",
      description:
        "Muscle/bone injuries: ACL, spinal disc issues, post-surgery support.",
    },
    {
      title: "Cardiac",
      description:
        "Medical conditions: Post-heart attack, bypass surgery, etc.",
    },
  ];

  return (
    <div>
      {/* Header */}
      <div className="header">
        <h1>AI Rehab</h1>
        <div>
          <button style={{ marginRight: "10px" }}>Get Started</button>
          <button style={{ marginRight: "10px" }}>About Us</button>
          <button onClick={() => navigate("/")}>Logout</button>
        </div>
      </div>

      <h2 style={{ textAlign: "center", marginTop: "20px" }}>Dashboard</h2>

      {/* Main content area */}
      <div className="main-content">
        {categories.map((card, index) => (
          <div key={index} className="card">
            <h3>{card.title}</h3>
            <p>{card.description}</p>
            <button
              onClick={() => handleStart(card.title.toLowerCase())}
              className="start-button"
            >
              Start
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
